import { useQuery } from "react-query";
import { fetchCoinPrice } from "../api";
interface IPrice {
  time_open: number;
  time_close: number;
  open: string;
  high: string;
  low: string;
  close: string;
  volume: string;
  market_cap: number;
}
interface PriceProps {
  coinId: string;
}
function Price({ coinId }: PriceProps) {
  const { isLoading, data } = useQuery<IPrice[]>(["priceQuery"], () =>
    fetchCoinPrice(coinId)
  );
  return (
    <div>
      {isLoading ? "Loading Price....." : data?.map((props) => props.close)}
    </div>
  );
}

export default Price;
